import React from "react";
import '../styles/Block.css'
function Block({imgPath, alt, title, text}) {
    return (
        <div className="block-card">
            <img src={imgPath} alt={alt}/>
            <h3>{title}</h3>
            <p>{text}</p>
        </div>
    )
}

export default Block
